(24, 'Design Patterns', '0201633612', '28.25', 'swang@scu.edu', '51szD9HC9pL._SX395_BO1,204,203,200_.jpg', , NULL, 'These texts cover the design of object-oriented software and examine how to investigate requirements, create solutions and then translate designs into code, showing developers how to make practical use of the most significant recent developments. A summary of UML notation is included.');
INSERT INTO `Book` (`id`, `name`, `isbn`, `price`, `email`, `imgname`, `image`, `phone`, `description`) VALUES
(25, 'Head First Design Patterns', '0596007124', '39.99', 'swang@scu.edu', '51szD9HC9pL._SX395_BO1,204,203,200_.jpg', , NULL, 'At any given moment, someone struggles with the same software design problems you have. And, chances are, someone else has already solved your problem. This edition of Head First Design Patternsâ€”now updated for Java 8â€”shows you the tried-and-true, road-tested patterns used by developers to create functional, elegant, reusable, and flexible software. By the time you finish this book, youâ€™ll be able to take advantage of the best design practices and experiences of those who have fought the beast of software design and triumphed.');
